import React from "react";
import {Container, Row, Col} from 'react-bootstrap'
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";

const App = () => {
    return (
        <div>
            <Container fluid>
                <Row>
                    <Col md={4} className='bg-warning ct-white'>
                        <Header/>
                    </Col>
                    <Col md={8}>
                        <Note/>
                        <Footer/>
                    </Col>
                </Row>
            </Container>
        </div>
    )
}

export default App;
